<p style="text-align: center;"><span style="color: #999999;"><span style="color: #bdbdbd;">. . .</span><br /><br /></span></p>
<p>In baseball, the pitcher is the player who throws the baseball from the pitcher's mound toward the catcher to begin each play, with the goal of retiring a batter, who attempts to either make contact with the pitched ball or draw a walk. In the numbering system used to record defensive plays, the pitcher is assigned the number 1. The pitcher is often considered the most important defensive player, and as such is situated at the right end of the defensive spectrum. There are many different types of pitchers, such as the starting pitcher, relief pitcher, middle reliever, lefty specialist, setup man, and closer.</p>
<p>Traditionally, the pitcher also bats. Starting in 1973 with the American League and spreading to further leagues throughout the 1980s and 1990s, the hitting duties of the pitcher have generally been given over to the position of designated hitter, a cause of some controversy. The National League in Major League Baseball and the Japanese Central League are among the remaining leagues that have not adopted the designated hitter position.</p>
<h3>1. Overview</h3>
<p>In most cases, the objective of the pitcher is to deliver the pitch to the catcher without allowing the batter to hit the ball with the bat. A successful pitch is delivered in such a way that the batter either allows the pitch to pass through the strike zone, swings the bat at the ball and misses it, or hits the ball poorly (resulting in a pop fly or ground out). If the batter elects not to swing at the pitch, it is called a strike if any part of the ball passes through the strike zone and a ball when no part of the ball passes through the strike zone.</p>
[caption id="attachment_751" align="alignnone" width="730"]<img class="wp-image-751 size-full" src="http://nikhil.cloudaccess.host/wp-content/uploads/visualcomposer-assets/templates/TP11000006/assets/elements/1b3f73c310f3041e057f22fc78ddb356.jpg" alt="" width="730" height="410" /> Baseball evolved from older bat-and-ball games already being played in England by the mid-18th century.[/caption]
<p>There are two legal pitching positions, the windup and the set position or stretch. Either position may be used at any time; typically, the windup is used when the bases are empty, while the set position is used when at least one runner is on base.</p>
<h3>2. Pitching in a game</h3>
<p>A skilled pitcher often throws a variety of different pitches to prevent the batter from hitting the ball well. The most basic pitch is a fastball, where the pitcher throws the ball as hard as he can. Some pitchers are able to throw a fastball at a speed over 100 miles per hour (160 km/h; 150 ft/s), ex., Aroldis Chapman. Other common types of pitches are the curveball, slider, changeup, cutter, sinker, screwball, forkball, split-fingered fastball, slurve, and knuckleball. These generally are intended to have unusual movement or to deceive the batter as to the rotation or velocity of the ball, making it more difficult to hit. Very few pitchers throw all of these pitches, but most use a subset or blend of the basic types. Some pitchers also release pitches from different arm angles, making it harder for the batter to pick up the flight of the ball.</p>
[caption id="attachment_750" align="alignnone" width="730"]<img class="wp-image-750 size-full" src="http://nikhil.cloudaccess.host/wp-content/uploads/visualcomposer-assets/templates/TP11000006/assets/elements/30e0239ec3e3d32ffd1efff3b3ff74f4.jpg" alt="" width="730" height="840" /> Baseball was brought by immigrants to North America, where the modern version developed.[/caption]
<p>There are a number of distinct throwing styles used by pitchers. The most common style is a three-quarters delivery in which the pitcher's arm snaps downward with the release of the ball. Some pitchers use a sidearm delivery in which the arm arcs laterally to the torso. Some pitchers use a submarine style in which the pitcher's body tilts sharply downward on delivery, creating an exaggerated sidearm motion in which the pitcher's knuckles come very close to the mound.</p>
